import '../Style/Navbar.css'
// import logo from '../disneylogo.svg'

const  Navbar= () => {
    return (
        <div className="navbar">
            <div className="logo">
            <img src='images/disneylogo.svg' alt="" />

            </div>
            <div className="navlinks">
                <ul>

                    <li><a href="">Home</a></li>
                    <li><a href="">Favourities</a></li>
                    <li><a href="">AddtoFavourities</a></li>
                    <li><a href="">Logout</a></li>
                </ul>


            </div>

        </div>
      );
}
 
export default Navbar;
